import './App.css';
import { useState, useEffect } from 'react';

function App() {

  const [topics, setTopics] = useState([])

  useEffect(()=> {
    fetch('http://localhost:3001/topics')
    .then(result => result.json())
    .then(topics => setTopics(topics))
  }, [])



  return (
    <div>
     {topics.map(topic => <div>{topic._id}</div>)}
    </div>
  );
}

export default App;
